script: |
  super -f text -I q9332.spq | sort > q9332.out

inputs:
  - name: q9332.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - ( + 16 ) NOT BETWEEN - ( + - 33 ) AND 83 + + - col1 / col0;
  - name: tab2

outputs:
  - name: q9332.out
    data: |
      46	51	23
      64	77	40
      75	67	58
